    function distance(x1, y1, x2, y2) {
        const xdist = x2 - x1;
        const ydist = y2 - y1;
        return Math.sqrt(Math.pow(xdist, 2) + Math.pow(ydist, 2));
    }
    function getRandomInt(ranNum, max, min){
        return Math.floor(Math.floor(ranNum * (max - min+1) ) + min);
    }
    function interpolate(pa, pb, px) {
                    var ft = px * Math.PI,
                        f = (1 - Math.cos(ft)) * 0.5;
                    return pa * (1 - f) + pb * f;
    }


    function Circle() {
        var circle = {};

        function init() {
            generateShape();
            circle.velocity = {};
            circle.velocity.x = (Math.random()* (0.1 +0.1) ) - 0.1;
            circle.velocity.y = (Math.random()* (0.1 +0.1) ) -0.1;
            circle.colorFill = "#bdc7ec";
            circle.colorStroke = circle.colorFill;
        };
        function generateShape() {
            circle.r = getRandomInt(Math.random(),15,5);
            circle.x = getRandomInt(Math.random(),window.innerWidth,0);
            circle.y = getRandomInt(Math.random(),window.innerHeight,(window.innerHeight*3)/4);
            for (let index = 0; index < circles.length; index++) {
                const element = circles[index];
                if(circle!==element.circle){
                    if (distance(circle.x, circle.y, element.circle.x, element.circle.y) < (circle.r + element.circle.r)) {
                        generateShape();
                        break;
                    }
                }
            }
        }

        function update() {
            if(ee){
                circle.colorFill="hsl("+(Math.random()*360)+",50%,70%)";
            }
            if(controllerState.mouse.left){
                if(distance(circle.x,circle.y,controllerState.mouse.x,controllerState.mouse.y)<60){
                    if(circle.x>controllerState.mouse.x){
                        circle.velocity.x=Math.abs(circle.velocity.x);
                    }else{
                        circle.velocity.x=-Math.abs(circle.velocity.x)
                    }
                    if(circle.y>controllerState.mouse.y){
                        circle.velocity.y=Math.abs(circle.velocity.y);
                    }else{
                        circle.velocity.y=-Math.abs(circle.velocity.y)
                    }
                }
            }

            if(circle.x>window.innerWidth+50||circle.x < -50||circle.y>window.innerHeight+50||circle.y < (((window.innerHeight*3)/4)-50)){
                generateShape();
            }
            if (circle.x > window.innerWidth - circle.r || circle.x < 0 + circle.r) {
                circle.velocity.x = -circle.velocity.x;
            }

            if (circle.y > window.innerHeight - circle.r || circle.y < (window.innerHeight*3)/4 + circle.r) {
                circle.velocity.y = -circle.velocity.y;
            }
            circle.x += circle.velocity.x;
            circle.y += circle.velocity.y;

            draw();
        }

        function draw() {

            c.beginPath();
            c.arc(circle.x, circle.y, circle.r, 0, 2 * Math.PI, false);
            c.fillStyle = circle.colorFill;
            c.fill();
            c.strokeStyle = circle.colorStroke;
            c.stroke();
        }

        return {
            circle,
            init,
            update
        };
    }

    function Node() {
        node = {};

        function init() {
            node.circle1;
            node.circle2;

            function generateCircles() {
                node.circle1=circles[getRandomInt(Math.random(),circles.length-1,0)].circle;
                node.circle2=circles[getRandomInt(Math.random(),circles.length-1,0)].circle;
                if(node.circle1===node.circle2){
                    generateCircles();
                }else{
                    for (let index = 0; index < nodes.length; index++) {
                        const element = nodes[index];
                        let coincidence=0;
                        if(element.circle1===node.circle1||element.circle1===node.circle2){
                            coincidence++;
                        }
                        if(element.circle2===node.circle1||element.circle2===node.circle2){
                            coincidence++;
                        }
                        if(coincidence===2){
                            generateCircles();
                            break;
                        }
                    }
                }
            }
            generateCircles();
            node.update=function(){
                this.draw();
            }
            node.draw=function(){
                c.beginPath();
                c.moveTo(this.circle1.x,this.circle1.y);
                c.lineTo(this.circle2.x,this.circle2.y);
                c.stroke();
            }
        }
        init();
        return node;
    }

    function Mist(){
        let mist={
            seed:Math.random(),
            currentCol:0,
            velocity:0.2,
            wavelength:400,
            amplitude:100,
            resolution:20,
            height:(window.innerHeight*4)/6,
            radius:50000,
            buffer:[],
            getHeight:function(col){
                noise.seed(this.seed);
                let height;
                if (!this.buffer[col]) {
                    let a = this.getPoint(col, 0, this.seed);
                    let b = this.getPoint(col, 1, this.seed);
                    if (col < 0) {
                        if ((col % this.radius) % this.wavelength === 0) {
                            height = this.height + a * this.amplitude;
                        } else {
                            height = this.height + interpolate(a, b, ((Math.abs(col) % this.radius) % this.wavelength) /
                                this.wavelength) * this.amplitude;
                        }
                    }
                    if ((col % this.radius) % this.wavelength === 0) {
                        height = this.height + a * this.amplitude;
                    } else {
                        height = this.height + interpolate(a, b, ((col % this.radius) % this.wavelength) /
                            this.wavelength) * this.amplitude;
                    }
                    this.buffer[col] = height
                } else {
                    height = this.buffer[col];
                }
                return height
            },
            getPoint: function (col, shift, seed, test) {
                let a = (Math.floor((col % this.radius) / this.wavelength));
                let b = 0;
                let next;
                noise.seed(seed);
                if (a === Math.floor(this.radius / this.wavelength)) {
                    b = 0;
                    next = true;
                } else {
                    b = a + 1;
                    next = false;
                }
                if (test === true) {
                    return {
                        a,
                        b,
                        next,
                        result: {
                            a: noise.simplex2(0, a),
                            b: noise.simplex2(0, b)
                        }
                    };
                }
                if (shift === 0) {
                    return noise.simplex2(1, a);
                } else {
                    return noise.simplex2(1, b);
                }
            },
            update: function () {
                if(ee){
                    this.wavelength=10;
                    this.amplitude=250;
                }
                let mistZone=[];
                for (let index = 0; index < window.innerWidth/this.resolution; index++) {
                    mistZone[index]=this.getHeight(index+this.currentCol);
                }
                this.currentCol=this.currentCol+this.velocity;
                this.draw(mistZone);
            },
            draw:function(mistZone){
                c.save();
                c.fillStyle="#FFFFFF"
                c.beginPath();
                c.moveTo(-400,0);
                for (let index = 0; index < mistZone.length; index++) {
                    const element = mistZone[index];
                    c.lineTo(index*this.resolution,element)
                }
                c.lineTo(window.innerWidth+300,mistZone[mistZone.length-1])
                c.lineTo(window.innerWidth,0)
                c.closePath();
                c.shadowColor = '#FFFFFF';
                c.shadowBlur = 150;
                c.shadowOffsetX = -75;
                c.shadowOffsetY = 150;
                c.fill();
                c.restore();
            }
        };
        return mist;
    }

    function Background(){
        let background={};
        background.color="hsl(227, 56%, 70%)";
        background.speed=5;
        background.current=0;
        background.update=function(){
            if(ee){
                this.color="hsl("+(this.current%360)+",50%,70%)";
                this.current=this.current+this.speed;
            }
            this.draw();
        }
        background.draw=function(){
            c.fillStyle = this.color;
            c.fillRect(0, 0, window.innerWidth, window.innerHeight);
        }
        return background;
    }

    var ee = false;
    var background=new Background();
    var circles = [];
    var nodes = [];
    var mist = new Mist();
    for (let index = 0; index < 20; index++) {
        var circle = new Circle();
        circle.init();
        circles.push(circle);
    };
    for (let index = 0; index < 20; index++) {
        var node = new Node();
        nodes.push(node);
    };

    function gameLogic() {
        drawingPile.push(background);
        for (let index = 0; index < circles.length; index++) {
            const element = circles[index];
            drawingPile.push(element);
        }
        for (let index = 0; index < nodes.length; index++) {
            const element = nodes[index];
            drawingPile.push(element);
        }
        drawingPile.push(mist);
    };
    var canvas = document.getElementById("background");
    canvas.style.zIndex=-99999999;
    canvas.style.position="fixed";
    canvas.style.top="0px";
    canvas.style.left="0px";
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;

    var c = canvas.getContext("2d");

    var fps = 60;
    var running = true;
    var drawingPile = [];

    // Canvas resizing
    window.addEventListener("resize", function (event) {
        canvas.width = window.innerWidth;
        canvas.height = window.innerHeight;
    });

    // Current controller state each iteration
    var controllerState = {
        mouse: {
            x: 0,
            y: 0,
            right: false,
            left: false,
            central: false,
            wheel: 0,
            rightClick: 0,
            leftClick: 0,
            centralClick: 0
        },
        keyboard: []

    };
    // Controller handling
    window.addEventListener("mousemove", function (event) {
        controllerState.mouse.x = event.x;
        controllerState.mouse.y = event.y;
    });
    window.addEventListener("mousedown", function (event) {
        switch (event.button) {
            case 0:
                controllerState.mouse.left = true;
                controllerState.mouse.leftClick = +1;
                break;

            case 1:
                controllerState.mouse.central = true;
                controllerState.mouse.centralClick = +1;
                break;

            case 2:
                controllerState.mouse.right = true;
                controllerState.mouse.rightClick = +1;
                break;

            default:
                break;
        }
    });
    window.addEventListener("mouseup", function (event) {
        switch (event.button) {
            case 0:
                controllerState.mouse.left = false;
                break;

            case 1:
                controllerState.mouse.central = false;
                break;

            case 2:
                controllerState.mouse.right = false;
                break;

            default:
                break;
        }
    });
    window.addEventListener("wheel", function (event) {
        controllerState.mouse.wheel += event.deltaY;
    });
    var input={
        save:"",
        count:0
    };
    window.addEventListener("keydown", function (event) {
        controllerState.keyboard.push(event.key);
        input.count++;
        if(input.count>=50){
            input.save="";
            input.count=0;
        }
        input.save += (event.keyCode)+" ";
        if(input.save.includes("67 79 82 67 72 85 82 65 86 69")){
            if(ee!==true){
                if(confirm("WARNING: if you suffer from photosensitive epilepsy please press cancel!")){
            ee=true;
            for (let index = 0; index < circles.length; index++) {
                const element = circles[index];
                element.circle.velocity.x = element.circle.velocity.x*200;
                element.circle.velocity.y = element.circle.velocity.y*200;
            }
            var snd = new Audio("data:audio/mp3;base64," + ``);
            snd.addEventListener('ended', function() {
                this.currentTime = 0;
                this.play();
            }, false);
            snd.play();
            input.save = "";
            input.count=0;}}
        }
    });

    //Resetting some assets after every loop finishes
    function loopReset() {
        // controllerState.mouse.right=false;
        // controllerState.mouse.left=false;
        // controllerState.mouse.central=false;
        controllerState.mouse.wheel = false;
        controllerState.mouse.rightClick = 0;
        controllerState.mouse.centralClick = 0;
        controllerState.mouse.leftClick = 0;

        controllerState.keyboard = [];

        drawingPile = [];
    }

    function gameLoop() {
        if (running) {
            requestAnimationFrame(gameLoop);
        }
        gameLogic();
        c.fillStyle = "#FFFFFF";
        c.fillRect(0, 0, window.innerWidth, window.innerHeight);
        for (let index = 0; index < drawingPile.length; index++) {
            drawingPile[index].update();
        }
        loopReset();

    }
    Array.contains = function (array, search) {
        var res = false;
        for (let index = 0; index < array.length; index++) {
            const element = array[index];
            if (element === search) {
                res = true;
                break;
            }
        }
        return res;
    }
    gameLoop();
